import Link from 'next/link';

const headerStyle = {
    margin: 100
};

const bodyStyle = {
    margin: 100
};

function myProjects() {
    return [
        { id: 'famtravel', title: 'Famtravel', link: 'http://www.famtravel.eu' },
        { id: 'superpower-rental', title: 'Superpower Rental',link: 'http://superpower-to-rent.herokuapp.com/' },
        { id: 'my-protein-shake', title: 'My Protein Shake', link: 'https://ohshakemyshake.herokuapp.com/' },
        { id: 'find-out-more', title: 'Find out more on github', link: 'https://github.com/xxinyiwho' },
    ];
};

const ProjectLink = ({ project }) => (
    <Link href="{project.link}">
        <a>{project.title}</a>
    </Link>
);

export default function Project() {
    return (
        <>
        <h2 className='my-projects' style={bodyStyle}>More about me</h2>
        <ul>
        {myProjects().map(project => (
            <li>
            <Link href="{project.link}" style={bodyStyle}>
                <a>{project.title}</a>
            </Link>
            </li>
        ))}
        </ul>
        </>
    );
}
